import './App.css';
import data from "./data" ; 


function App() {
  return (
    <div className='ListCrypto'> 
     <ul> 

    { 
      data.map(token => (
        <li key={token.nameCoin}>
        <h1>{token.nameCoin} </h1> </li>
      ))
    }
    </ul>








    </div>
  );
}

export default App;
